import React from 'react';
import { Link } from 'react-router-dom';
import games from '../gamesData';

function GameList() {
  return (
    <div>
      <h2>구매가능한 게임</h2>
      <ul>
        {games.map(game => (
          <li key={game.id}>
            <Link to={`/game/${game.id}`}>{game.name}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default GameList;
